import React, { Component } from 'react';
import "./App.css";

class Navbar extends Component {

    render () {
      return (
          <nav className='navbar navbar-light fixed-top bg-white flex-md-nowrap shadow self-border-bottom-5'>
              <a
                className='navbar-brand col-sm-3 col-md-2 mr-0'
                href="/"
                target='_blank'
                rel='noopener noreferrer'>Smart <span className="text-success">Farm</span></a>

                <ul className="navbar-nav px-3">
                    <li className="nav-item text-npwrap d-none d-sm-none d-sm-block">
                        <small className="text-dark">
                            <span id="account">
                                { this.props.account }
                            </span>                                
                        </small>
                    </li>
                </ul>

          </nav>
        );
    }
}

export default Navbar;
